import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from './serviceWorker';
import Form from './common/form/main';
serviceWorker.register();

const formdata = {
    method : '',
    class : '',
    token : '',
    hash : '',
    cont : {
        name :'',
        sex :'',
        reg :'',
    }
};

ReactDOM.render(<Form data={formdata} />, document.getElementById('app'));

serviceWorker.unregister();
